import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
            <body>
             <a href="https://steam.com/openid/login">
                 <img src="https://steamcdn-a.akamaihd.net/steamcommunity/public/images/steamworks_docs/spanish/sits_large_noborder.png">
                 </img>
             </a>
            </body>
      </header>
    </div>
  );
}

export default App;
